// Gravity Brand Colors 2022

// Primary
$lime:          #91C73D;
$navy:          #253750;

// Secondary
$green:         #519D18;
$teal:          #29A59C;
$blue:          #107AB0;
$purple:        #545DA9;

// Tertiary
$red:           #DC2E50;
$orange:        #DC7539;
$yellow:        #E7A239;

// Grays
$cloud:         #FAFAFB;
$silver:        #CACED0;
$pewter:        #7E868C;
$charcoal:      #20282F;

// Backgrounds
$mint:          #EDF3EC;
$indigo:        #353F69;



$bg-gradient-primary: linear-gradient(180deg, $dsm-color-blue-10 0%, $dsm-color-blue-30 100%);
$bg-gradient-dark: linear-gradient(135deg, $dsm-color-blue-80 0%, $dsm-color-blue-100 100%);


$black:		#000;
$white:		#fff;

$theme-colors: (
  primary: $navy,
  secondary: $green,
  secondary-20: $dsm-color-green-20,
  gray: $pewter,
  light-gray: $silver,
  lighter-gray: $cloud,
  lightest-gray: $cloud,
  body: $charcoal,
  body-muted: $dsm-color-neutral-50,
  body-link: $green,
  body-link-hover: $dsm-color-green-40,
  highlight: $dsm-color-green-05,
  btn-text-dark: $dsm-color-base-dark,
  btn-text-light: $white,
  btn-primary: $dsm-color-base-blue,
  btn-primary-hover: $dsm-color-blue-70,
  btn-secondary: $green,
  btn-secondary-hover: $dsm-color-green-40,
  btn-white: $white,
  btn-white-hover: $dsm-color-base-light,
  btn-nav: $green,
  btn-nav-hover: $dsm-color-green-40,
  icon-green-bg: $dsm-color-green-10,
  icon-green-light: $dsm-color-primary-green,
  icon-green-dark: $dsm-color-base-green,
  icon-violet-bg: $dsm-color-violet-10,
  icon-violet-light: $dsm-color-violet-30,
  icon-violet-dark: $dsm-color-violet-50,
  icon-red-bg: $dsm-color-red-10,
  icon-red-light: $dsm-color-red-30,
  icon-red-dark: $dsm-color-red-50,
  icon-blue-bg: $dsm-color-blue-10,
  icon-blue-light: $dsm-color-blue-30,
  icon-blue-dark: $dsm-color-blue-50,
  icon-teal-bg: $dsm-color-teal-10,
  icon-teal-light: $dsm-color-teal-30,
  icon-teal-dark: $dsm-color-teal-50
);


/** Bootstrap navbar fix (https://git.io/fADqW) */
$navbar-dark-toggler-icon-bg: none;
$navbar-light-toggler-icon-bg: none;

$border-radius-base: 	0.25rem;

$transition-fast: 0.15s;

/* sage/assets/styles/common/_variables.scss */
// Slick Carousel font path
$slick-font-path: "~slick-carousel/slick/fonts/";

// Slick Carousel ajax-loader.gif path
$slick-loader-path: "~slick-carousel/slick/";

// Fonts
$font-weight-normal:      400;
$font-weight-medium:      500;
$font-weight-semibold:    600;
$font-weight-bold:        700;
$font-weight-extrabold:	  800;
$font-weight-black:       900;

// Transitions
$transition-speed-slow:	0.5s;
$transition-speed-med: 0.3s;
$transition-speed-fast: 0.15s;

// Buttons
$btn-shadow: 0 4px 15px rgba(10,10,10,0.3);
$btn-shadow-hover: 0 8px 20px rgba(10,10,10,0.3);

// Cards
$card-border-radius: 8px;
$card-box-shadow: 0 50px 100px rgba(10,10,10,0.15);

// Documentation Sidebar
$main-sidebar-width: 290px;
